Alter Table #hl_temp Add Id Int Identity(1, 1)

--#1
SELECT COUNT(1) FROM(
	SELECT distinct  id,SUBSTRING(kod,n,1) as charVal FROM #HL_TEMP h  INNER JOIN
	(SELECT TOP (100) n = ROW_NUMBER() OVER (ORDER BY number) FROM [master]..spt_values ) t on len(h.kod)>n and SUBSTRING(kod,n,1) !=';'
)t

SELECT CAST(id as int) id,questions,value as part INTO #hl_part FROM(
SELECT *,len(kod) - len(replace(kod, ';', '')) as questions FROM #hl_temp h
CROSS APPLY STRING_SPLIT(kod, ';') as temp WHERE value!='') t
Alter Table #hl_part Add userId Int Identity(1, 1)

SELECT  id FROM #hl_part INNER JOIN
(SELECT TOP (40) n = ROW_NUMBER() OVER (ORDER BY number) FROM [master]..spt_values ) t on len(part)>n-1
GROUP BY id,SUBSTRING(part,n,1)
HAVING COUNT(distinct userid)=MAX(questions) 
SELECT @@ROWCOUNT --#2